import React from 'react';

const UserList = ({users}) => {
    console.log(users)
    return(
        <div>
            {users&&users.result.map((result) =>{
                <li key={result.contactName}>name {result.contactName}</li>
            })}
            
            
            


        </div>
    );
};

export default UserList;
